import { ChangeEvent, MouseEventHandler } from "react";
import styled from "styled-components";


export const MaterialUISpan = (props: {type:string}) => {
    return <span className="material-symbols-outlined">{props.type}</span>
}

const StyledFileSearchButton = styled("button")`
    border-radius: 0.5rem;
    text-align: center;
    width: 5rem;
    &:hover{
        transform: scale(1.1);
    }
`


export const FileSearchButton = (props: {onClick: MouseEventHandler<HTMLButtonElement>})=>{

    return <StyledFileSearchButton onClick={props.onClick}>
        <MaterialUISpan type={"search"}/>
    </StyledFileSearchButton>
}
